import React from 'react'
// import { Link } from 'react-router-dom'

export default function NewContact() {
  return (
    <div className = "NewContactForm">
      <input className = "NameInput"></input>
      <input className = "LastNameInput"></input>
      <input className = "EmailInput" type="email"></input>
      <input className = "BirthDateInput" type="date"></input>
      <input className = "PhoneInput"></input>

    </div>
  )
}
